import {Button, Card} from "react-bootstrap";

function Footer({text}){
    const style = {
       padding: 40,
       backgroundColor: 'gray',
       color: 'green',
       textAlign: 'center'
    }
    return(
        <footer style={style}>
            {text}
            <Card style={{ height: '120px' }} className="flex-row mx-md-4 ">
                <Card.Img variant="top" src="./logo192.png"  style={{ height: '100px', width: '100px' }}/>
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                        Some quick example text to build on the card title and make up the bulk of
                        the card's content.
                    </Card.Text>
                </Card.Body>
            </Card>
        </footer>
    );
}

export default  Footer;
